import GenerateScormPage from './pages/generateScormPage';
import SecondStage from './pages/secondStage';
import './App.css';
import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Route path="/" exact component={GenerateScormPage}/>
        <Route path="/second" exact component={SecondStage}/>
     </div>
     </Router>
  );
}

export default App;
